import React from 'react';
import AppLayout from '../components/AppLayout';

const Profile = () => {
  return(
    <>
      <Head>
        <meta charSet="utf-8"/>
        <title> 내 프로필 | NodeBird </title>
      </Head>
      <AppLayout>
        <dev> 내 프로필 </dev>
      </AppLayout>
    </>
  )
}

export default Profile;
